Liandra Dahl, Matisse, Mistress Basia, Cava Cabaret, Saskia Condal, Lady Diamond, Samia Duarte, Didac Duran, Tony Fontana, Mario Mentrup, Sofia Prada, Luizo Vega

An Erotic Film By Acclaimed Writer And Director Erika Lust!

From Erika Lust, writer and director of acclaimed Five Hot Stories for Her and Life Love Lust, Cabaret Desire is a new indie-adult film set in a night of erotic readings. In a magic and bohemian place where people go after dark to hear erotic tales, dancers, musicians and poets create a sensual atmosphere. Cabaret Desire is a journey through four tales of intimacy, love, passion and sex!
